static void lineCount()
{
  static int tabSize = Config::getInt("tab-size");
  const char *p;

  for (p = parse_cstyle_YYtext; *p; ++p) {

      if (*p == '\n') {
         yyLineNr++;
         s_column = 0;
         yyColNr  = 1;

      } else if (*p == '\t') {
         s_column += tabSize - (s_column % tabSize);

      } else {
         s_column++;
         yyColNr++;
      }
   }
}

static int computeIndent(const QString &str, int startIndent)
{
   static int tabSize = Config::getInt("tab-size");
   int col = startIndent;
  
   for (auto c : str) { 
 
      if (c == '\t') {
         col += tabSize-(col % tabSize);
      
      } else if (c == '\n') {
         col = 0; 
      
      } else {
         col++;

      }
  }

  return col;
}

static void addType(QSharedPointer<Entry> ce)
{
   uint tl = ce->type.length();

   if (tl > 0 && ! ce->name.isEmpty() && ce->type.at(tl - 1) != '.') {
      ce->type += ' ' ;
   }

   ce->type += ce->name;
   ce->name.resize(0);
   tl = ce->type.length();

   if (tl > 0 && ! ce->args.isEmpty() && ce->type.at(tl - 1) != '.') {
      ce->type += ' ';
   }

   ce->type += ce->args;

   ce->args.resize(0) ;
   ce->argList.clear();    
}

static QString stripQuotes(const QString &str)
{ 
   QString name = str;

   if (str.isEmpty()) {
      return name;
   }

   if (name.startsWith('\"') && name.endsWith('\"')) {
     name = name.mid(1, name.length()-2);
   }

   return name;
}

